import React, { Component } from "react";
import bank from "../bank.png";
import { Dropdown } from "react-bootstrap";

// create class for component
class Navbar extends Component {
  render() {
    return (
      <div
        style={{
          position: "absolute",
          height: "60px",
          display: "flex",
          justifyContent: "space-around",
        }}
        expand="lg"
      >
        hello
      </div>
    );
  }
}

export default Navbar;
